import logo from './images/art.png'




function Project(props) {
  return (
    <div>
      <h1>Project</h1>
      <ProjectCard
        link="/proj1"
        image="./images/art.png"
        title="rem"
        category="Film"
      />
    </div>
  )
}


export default Project;
